import 'tachyons';
import React from 'react';
import './brains.png';
import Tilt from 'react-parallax-tilt';
import brains from './brain.png';

function logos(){
    return(
        <div className='ma4 mt0 ' style={{width:'200px', height:'200px'}}>
            <Tilt className='tc shadow-3 br4'>
                <div style={{ height: '200px',width: '200px',  backgroundColor: 'transparent' }}>
                    <img src='' />
                </div>
          </Tilt>
        </div>
    )
}
export default logos;
